    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2015-05-07T14:36:09.601198",nt"name":
    "kepler",nt"isopen": true,nt"url": null,nt"notes": "The centuries-old
    quest for other worlds like our Earth has been rejuvenated by the intense excitement
    and popular interest surrounding the discovery of hundreds of planets orbiting other
    stars. There is now clear evidence for substantial numbers of three types of exoplanets;
    gas giants, hot-super-Earths in short period orbits, and ice giants. The following
    websites are tracking the day-by-day increase in new discoveries and are providing
    information on the characteristics of the planets as well as those of the stars
    they orbit: The Extrasolar Planets Encyclopedia, NASA Exoplanet Archive, New Worlds
    Atlas, and Current Planet Count Widget.&#160;&#160;The challenge now is to find
    terrestrial planets (i.e., those one half to twice the size of the Earth), especially
    those in the habitable zone of their stars where liquid water and possibly life
    might exist. The Kepler Mission, NASA Discovery mission #10, is specifically designed
    to survey a portion of our region of the Milky Way galaxy&#160;to discover dozens
    of Earth-size planets in or near the habitable zone and determine how many of the
    billions of stars in our galaxy have such planets. Results from this mission will
    allow us to place our solar system within the continuum of planetary systems in
    the Galaxy.",nt"license_title": "U.S. Government Work",nt"extras": [{ntt"key":
